import "./share.css";

const Share = () => {
  return (
    <div className="share">
      <div className="shareWrapper">
        <div className="shareTop">
          <img className="shareProfileImg" src="/assets/person/1.jpeg" alt="" />
          <input placeholder="Whatcha thinking about?" className="shareInput" />
        </div>
        <hr className="shareHr" />
        <div className="shareBottom">
          <div className="addFeaturesButtons">
            <button className="addPhotoButton">Add Photos</button>
            <button className="tagPeopleButton">Tag People</button>
            <button className="addLocationButton">Add Location</button>
          </div>
          <button className="shareButton">Share Now</button>
        </div>
      </div>
    </div>
  );
};

export default Share;
